import { DEFAULT, TIER } from '@/contants';

export const getBronzeImg = `data:image/png;base64,`;

export const getSilverImg = `data:image/png;base64,`;

export const getIronImg = `data:image/png;base64,`;

export const getGoldImg = `data:image/png;base64,`;

export const getPlatinumImg = `data:image/png;base64,`;

export const getDiamondImg = `data:image/png;base64,`;

export const getMasterImg = `data:image/png;base64,`;

export const getGrandmasterImg = `data:image/png;base64,`;

export const getChallengerImg = `data:image/png;base64,`;
export const getLogoImg = `data:image/png;base64,`;

export const getImgMap = () => {
  const imgMap = new Map();
  imgMap.set(TIER.IRON, getIronImg);
  imgMap.set(TIER.BRONZE, getBronzeImg);
  imgMap.set(TIER.SILVER, getSilverImg);
  imgMap.set(TIER.GOLD, getGoldImg);
  imgMap.set(TIER.PLATINUM, getPlatinumImg);
  imgMap.set(TIER.DIAMOND, getDiamondImg);
  imgMap.set(TIER.MASTER, getMasterImg);
  imgMap.set(TIER.GRANDMASTER, getGrandmasterImg);
  imgMap.set(TIER.CHALLENGER, getChallengerImg);
  imgMap.set(DEFAULT, getLogoImg);

  return imgMap;
};
export const getTierImg = (tier: string | null) => {
  const im = getImgMap();

  return im.get(tier) ? im.get(tier) : im.get(DEFAULT);
};
